import React from 'react';
import 'NavBar.css';

function NavBar() {
    return <nav className="nav">
        <h1 className="site-title">Random Walk Simulation</h1>
        <ul>
            <li>
                <a href="/classical">Classical Simulation</a>
            </li>
            <li>
                <a href="/quantum">Quantum Simulation</a>
            </li>
        </ul>
    </nav>
}

export default NavBar;
